A binding can be created for a struct by using a constructor method, which is a static method associated to the struct that returns a new instance. The field constructor ( Foo {a : 0, ...}) is not directly used by Lockjaw since methods are more expressive when a none injected field needs a default value or when transformations are needed on the input. A struct can be made injectable by marking a struct impl block with the #[injectable] attribute, and then mark the constructor method as #[inject] . struct Foo {} #[injectable]
impl Foo { #[inject] pub fn new() -> Foo { Foo {} }
} Now Lockjaw understands when trying to create Foo, it should call Foo::new(). Note that since it is an associated method, constructor injection only works on a type you own ( you can actually change its implementation). For foreign types like imported crates a different method will be discussed in the providing objects chapter.

19.body:
To create an object, it may many need objects of other types. This is called dependencies . In this example, Bar depends on having an instance of Foo to be created. In constructor injections, dependencies are listed with its parameters. Lockjaw will try to use available bindings to create all arguments and pass them to the constructor. If a parameter does not have a binding, Lockjaw will fail compilation with missing bindings . Note that since we are not asking Lockjaw to actually create the object yet, binding validation won't be performed. Lockjaw is assuming there are some bindings else where it does not know about yet. struct Bar { foo: Foo, i: i32,
} #[injectable]
impl Bar { #[inject] pub fn new(foo: Foo) -> Bar { Bar { foo, i: 42 } }
} If the struct has other fields that can be initialized without injection, like i, it can be directly assigned. If the object needs a runtime value (for example, if i needs to be assigned by the caller with a user input), then factories will be needed, which will be discussed later.

