Obviously Lockjaw is not going to ask the world to use it or the user to rewrite everything they use with it, so it gives other ways to bind types. Since these bindings are no longer the "one true way to create things", and different bindings for the same type may be needed within the same program, the user needs to be able to select which bindings to use in each dependency graph. In Lockjaw, these elective bindings are defined in modules , and the component can choose what modules to install , which imports its bindings. Note that in Lockjaw documentation modules always refer dependency injection modules, and mod will be used to refer to Rust modules. To declare a module with Lockjaw the #[module] attribute should be used to mark the impl block of a struct. struct MyModule {} #[module]
impl My Module { ...
} The impl block will contain the binding definitions. For now the modules should be static (without fields). Modules with fields will be discussed in builder modules

28.body:
#[module] on its own is just a collection of bindings and does not do anything. It must be installed in a #[component] to joint the dependency graph. This is done by listing the module type in the modules metadata of the component. #[component(modules: [MyModule])]
trait MyComponent { fn i32(&self) -> i32; fn string(&self) -> String;
} A lot of Lockjaw attribute macros also takes metadata arguments , which is comma separated key : value pairs in a parenthesis. The values are usually string literal, integers, types, arrays of values (foo : [value 1, value 2]), or more metadata (foo : { key : value }). In this case modules takes an array of types (of #[modules]). Providing trait is a bit more complicated and will be discussed later . Source of this chapter

29.body:
In the previous chapter the modules are without fields, so Lockjaw can easily create instances of it (In fact no instance are created since Lockjaw can just call the static methods). However sometimes we want to be able to affect the values that are bound at runtime, hence need to be able to change what #[provides] does using fields in the module. struct MyModule { i: i32,
} #[module]
impl MyModule { #[provides] pub fn provide_i32(&self) -> i32 { self.i }
} Since the struct now has fields Lockjaw can no longer automatically create it, the user must manually pass in the modules when creating the component. Implementation note: While Lockjaw can also try to use Default or some other mechanisms, usages like this implies the module has mutable state and generally is a bad idea.

30.body:
Instead of passing the runtime modules to the component one by one, they are collected in a single struct annotated by the #[builder_modules] attribute. #[builder_modules]
struct MyBuilderModules { my_module: MyModule,
} Every field in the struct should be a module. Using a struct makes sure each module will be required by the compiler/IDE while exposing the least amount of generated code(which is harder for users and IDEs to understand, it is better to spell everything out in visible code.). The #[builder_modules] can then be installed in the component using the builder_modules metadata #[component(builder_modules: MyBuilderModules)]
trait MyComponent { fn i32(&self) -> i32;
} The component only accepts one#[builder_modules], which is likely to be specifically tailored for the component. The modules itself can be shared. The builder_modules metadata can be used at the same time with the modules metadata . modules should be preferred whenever possible as they are easier to use.

