If the builder_modules metadata is specified, the #[builder_modules] struct will become the parameter for the build() method of the component which the user must pass. #[test]
fn test() { let my_module = MyModule { i: 42 }; let my_builder_modules = MyBuilderModules { my_module }; let component: Box<dyn MyComponent> = <dyn MyComponent>::build(my_builder_modules); assert_eq!(component.i32(), 42); let other_component: Box<dyn MyComponent> = <dyn MyComponent>::build(MyBuilderModules { my_module: MyModule { i: 123 }, }); assert_eq!(other_component.i32(), 123);
