A trait can be provided using the #[provides] binding. #[provides] pub fn provide_i32_maker(impl_: I32MakerImpl) -> Box<dyn I32Maker> { Box::new(impl_) } However, Lockjaw is going to be particular when trying to request a trait object from the dependency graph. The concrete implementation of the trait may contain reference to the component , but ideally this is not something the consumer of the trait should care about, so Lockjaw enforces that any trait it provides must not outlive the component. The worst case 'ComponentLifetime is assumed, so consumers don't have to change when it actually happens. The Box returned by the component must be bound by the component's lifetime(same as self). #[component(modules: [MyModule])]
trait ProvideComponent { fn i32_maker(&'_ self) -> Box<dyn I32Maker + '_>;
}

