While #[provides] kind of works, binding an implementation to a trait interface is a common operation so Lockjaw has the #[binds] attribute to make them easier to use. For an interface and an implementation: pub trait Logger { fn log(&self, msg: &str);
} struct StdoutLogger; #[injectable]
impl StdoutLogger { #[inject] pub fn new() -> StdoutLogger { StdoutLogger }
} impl Logger for StdoutLogger { fn log(&self, msg: &str) { println!("{}", msg); }
} #[binds] can be used to create binding that says "when the Logger interface is needed, use StdoutLogger as the actual implementation": #[binds] pub fn bind_stdout_logger(_impl: StdoutLogger) -> Cl<dyn Logger> {} The method body must be empty, as Lockjaw will replace it. The Cl in the return type means C omponent l ifetimed, which is a wrapper around a type forcing it not outlive the component. Having this wrapper makes it easier for the compiler to deduce the lifetime. With the binding defined the Logger can now be used by other classes, without caring about the actual implementation. pub struct Greeter<'component> { logger: Cl<'component, dyn Logger>,
} #[injectable]
impl Greeter<'_> { #[inject] pub fn new(logger: Cl<dyn Logger>) -> Greeter { Greeter { logger } } pub fn greet(&self) { self.logger.log("helloworld!"); }
} Note that Logger still has to be injected as Cl<dyn Logger>, and Greeter is also bound by the lifetime of the component.

