StdoutLogger writes its output straight to the console, so it is hard to verify Greeter actually sends the correct thing. While we can give StdoutLogger special apis to memorize what it logs and give access to tests, having test code in prod is generally bad practice. Instead we can use dependency injection to replace the environment Greeter runs in. We can create a TestLogger that writes the logs to memory and can read it later, bind it to the Logger with a module, and install the module in a component for test that has all test bindings. We are than able to test Greeter without adding test code to the Greeter itself: #[cfg(test)]
pub mod testing { use crate::{Greeter, Logger}; use lockjaw::{component, injectable, module, Cl}; static mut MESSAGES: Vec<String> = Vec::new(); pub struct TestLogger; #[injectable] impl TestLogger { #[inject] pub fn new() -> TestLogger { TestLogger } pub fn get_messages(&self) -> Vec<String> { unsafe { MESSAGES.clone() } } } impl Logger for TestLogger { fn log(&self, msg: &str) { unsafe { MESSAGES.push(msg.to_owned()) } } } pub struct TestModule; #[module] impl TestModule { #[binds] pub fn bind_test_logger(_impl: TestLogger) -> Cl<dyn Logger> {} } #[component(modules: [TestModule])] pub trait TestComponent { fn greeter(&self) -> Greeter; fn test_logger(&self) -> TestLogger; } #[test] fn test() { let component: Box<dyn TestComponent> = <dyn TestComponent>::build(); component.greeter().greet(); assert_eq!( component.test_logger().get_messages(), vec!["helloworld!".to_owned()] ); }
} Generally, a library should also provide a test implementation and a module that binds the test implementation. The consumer of the library can then test by installing the test module instead of the real module. This allows test infrastructure to easily be shared. Some kind of test scaffolding can also be created to auto generate the component and inject objects into tests, but that is out of scope for lockjaw itself. Note that in the TestLogger MESSAGES is a static mutable, since log() and get_messages() is going to be called on different instances of TestLogger. This is unsafe and bad, so in the next chapter we will discuss how to handle this by forcing a single instance of TestLogger to be shared among everything that uses it. Source of this chapter

