Scopes enforces an object to be a singleton within the component, so everyone can interact with the same instance. However there are times when we need multiple sets of such instances. For example, we might be implementing a web server, and there are a lot of shared resources with every session. We want the session to be independent, so we need to create component for each session: impl Server { pub fn new_session(url: Url) -> Session { Session{ component: <dyn SessionComponent>::build({url,...}) } }
} However, there are also some resource that belongs to the whole server shared by all sessions, for example, an IO bound thread pool. We have to rebind this in every SessionComponent impl Server{ #[inject] pub fn new(#[qualified(IoBound)] io_threadpool: &ThreadPool) { ... } pub fn new_session(&self, url: Url) -> Session { Session { component: <dyn SessionComponent>::build({ url, self.io_threadpool, ... }) } }
} Managing these will soon get ugly. Instead we can create a #[subcomponent] which can have distinct scoped bindings, modules, but also has access to bindings in its parent component. Using #[subcomponent] is almost identical to a regular #[component], except that the #[subcomponent] has to be installed in a parent component, and the method to create an instance.
